                                <label>Anchura de la señalización</label>
                                <input
                                    type='number'
                                    name='hueco6'
                                    value={form.input10}
                                    onChange={(e) =>
                                        setForm((lastValue) => ({
                                            ...lastValue,
                                            input10: e.target.value,
                                        }))
                                    }
                                />
                            </div>
                        </div>
